import { Button } from "reactstrap";
import "./Servicos.css"

const Servicos = (props) => {
    return (<div className="container-servicos">
        <a href="/servicos">
            <img src={props.src}></img>
            <h1>{props.titulo}</h1>
            <p>{props.descricao}</p>
        </a>
    </div>);
}

export default Servicos;
